import axios from "axios";

export default function Get() {

  const baseURL = "https://aleksiej.website/random/";
  axios.get(baseURL)
  .then((response) => {
    // console.log(response.data);
    console.log(response.data[0].recipes[0].map((x) => [x.id.$numberInt, x.title, x.image, x.summary, x.instructions, x.license, x.spoonacularSourceUrl]));
    console.log(response.data[0].recipes[0]);

    console.log(response.data[0].recipes[0].extendedIngredients.map((x) => [x.id.$numberInt, x.original, x.image, x.aisle] ));
    /*  
    console.log(response.status);
    console.log(response.statusText);
    console.log(response.headers);
    console.log(response.config);
    */
  })
  .catch(function (error) {
          console.log(error);
  });

  return ("ok")
}

